import React, { Component, Fragment } from 'react';

class List extends Component {

    render() {
        return (
        	<Fragment>
        		<ul>
	           	{ 
	           		this.props.tasks.map((item, index) => { return <li key = {index}>{item.name}</li> })
	           	}
	           	</ul>	
	        </Fragment>
        );
    }
}

export default List;
